import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-image: linear-gradient(to bottom, #131424, #343b7c);
  display: flex;
`;
const Right = styled.div`
  flex: 1;
  background-color: red;
`;
const Left = styled.div`
  flex: 1;
  /* background-color:yellow ; */
`;
const Title = styled.h1`
  color: white;
  font-size: 76px;
  text-align: right;
  margin-right:10% ;
`;
const Desc = styled.p`
  /* width: 50%; */
  color: white;
  text-align: right;
  margin-left: 13%;
`;
const OurMotive = () => {
  return (
    <Container>
      <Left></Left>
      <Right>
        <Title>My Ambition</Title>
        <Desc>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rem quam
          earum eum beatae, officiis ad adipisci quos cumque quod quis numquam
          aliquid, optio odio saepe! Rerum, pariatur ab, recusandae molestiae
          dolorum laboriosam voluptate odio fugit reiciendis tempora at aliquam
          dolore?
        </Desc>
      </Right>
    </Container>
  );
};

export default OurMotive;
